function App() {  // es un obj de JS con propiedades CSS
    let estiloLogo = {
        width:"10em" ,
        height:"10em"
    }
    return(
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt= "logo"/> 
                {// lee el logo que ya hemos importado arriba
                }
                <p> Estamos en el fichero <code>App.js</code></p>
            </header>
        </div> 
    );
}
export default App;
